import React from 'react';
import { Routes , Route } from 'react-router-dom';
import StoreSection from './StoreSection';
import StoreSection2 from './StoreSection2';


const Main = () => {

    return (
        <Routes>
            <Route path="/" element={<StoreSection />} />
        </Routes>
    );
}

export default Main;
